import React, { useState } from "react";
import { Form, FormControl } from "react-bootstrap";

export default function CreateItem() {
  const [formData, setFormData] = useState({
    textInput: "",
    dropdownInput: "",
    dropdownInput: "",
  });

  const handleChange = (event) => {
    const { name, value } = event.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Do something with the form data here, such as send a request to a server
  };

  return (
    <Form onSubmit={handleSubmit}>
      <Form.Group controlId="formTextInput">
        <Form.Label>Color</Form.Label>
        <FormControl
          type="RGB"
          name="Color"
          value={formData.textInput}
          onChange={handleChange}
        />
      </Form.Group>

      <Form.Group controlId="formPasswordInput">
        <Form.Label>Apparel type</Form.Label>
        <FormControl
          type="password"
          name="passwordInput"
          value={formData.dropdownInput}
          onChange={handleChange}
        />
      </Form.Group>

      <Form.Group controlId="formDropdownInput">
        <Form.Label>Dropdown Input</Form.Label>
        <FormControl
          as="select"
          name="dropdownInput"
          value={formData.dropdownInput}
          onChange={handleChange}
        >
          <option value="">Select an option</option>
          <option value="option1">Option 1</option>
          <option value="option2">Option 2</option>
          <option value="option3">Option 3</option>
        </FormControl>
      </Form.Group>

      <button type="submit">Submit</button>
    </Form>
  );
}
